import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <div className="home-container">
            <div className="home-image-container">
                <img src={`${process.env.PUBLIC_URL}/home.gif`} alt="Home" className="home-image" />
            </div>
            <div className="home-text">
                <h2>Gaming <br></br> Streaming<br></br>both?</h2>
                <p>We have the best components</p>
            </div>
            <div className="whatsapp-button">
                <a href="https://wa.me/yourwhatsappnumber" target="_blank" rel="noopener noreferrer">
                    <img src={`${process.env.PUBLIC_URL}/whalogo.png`} alt="WhatsApp" />
                </a>
            </div>
            <div className="products-button">
                <Link to="/products">
                    <button className="custom-button">Our Components</button>
                </Link>
            </div>
        </div>
    );
}

export default Home;
